const kanji_guess_map = new Map([
["怒","おこ"], // いかり
["今日","きょう"], // こんにちは
["働","はたら"], // ドウ
["思","おも"], // し
["言","い"],
]);

module.exports.getFurigana = function(kanji) {
    let result = kanji_map.get(kanji);
    if (!result) {
        result = kanji_guess_map.get(kanji);
    }
    return result;
};